import './App.css';
import Button from './components/button/Button';


function App() {
  const helloHandler=(e)=>{
     console.log(e.target);
  }
  return (
      <Button name="hello"  variant='primary' color='white' clickHandler={helloHandler}/>

  );
}

export default App;
